import React from 'react';
import { Input, Button, Form } from 'antd';

// 타임라인 역할
const Home = () => {
    return (
        <>
            <div>Hello, TODAY!</div>
            <Form>
                <Input.TextArea
                    placeholder="오늘의 이야기를 적어보세요"
                    maxLength={140}
                    autoSize={{ minRows: 4, maxRows: 4 }}
                />
                <div style={{ padding: 10}}>
                    <Button >Image</Button>
                    <Button type="primary" style={{ float : 'right'}}>Post</Button>
                </div>
            </Form>
        </>
    );
};

export default Home;
